import React from 'react'
import header from '../../../asset/logo/header.svg';

export default function Header() {
  return (
    <div>
        <div className='bg-header py-[30px]'>
            <div className='flex justify-center'>
                <img src={header} alt='header' className=''/>
            </div>
        </div>
      
    </div>
  )
}
